import './TodoSearch.css';
import React from 'react';
function TodoSearch({searchValue, setSearchValue}) {

    return(
      <input 
      className='TodoSearch' 
      type="text"
      value={searchValue}
      placeholder="Coloca el elemento a Buscar"
      onChange={(e) => setSearchValue(e.target.value)} 
      />
    );
  }
  export {TodoSearch};
